import React from 'react';

const RenderAboutTile = (props) => {

    const thisClassName = "fa " + props.icon + " fa-2x";

    return(

        <div className="row">
            <div className="col-12 about-tile  text-center ">
                <div className={thisClassName}></div>
                <div>{props.value}</div>
                <div>{props.text}</div>
            </div>                
        </div>

    );

}

export default RenderAboutTile;
